import React from "react";
import { Link } from "react-router-dom";
const Navbar = () => {
    return (
        <div>
            <link>
                <img></img>
            </link>
            <nav>
                <ul>
                    <link></link>
                    <link></link>
                    <link></link>
                </ul>
            </nav>
        </div>
    );
}
export default Navbar;
